description:
PreMOn (PRedicate Model for ONtologies) is a linguistic resource for representing predicate models (i.e., PropBank, NomBank, VerbNet, FrameNet), their annotations, the mappings between them (e.g, SemLink, PredicateMatrix), and the mappings to frame-based ontologies in RDF/OWL. PreMOn consists of two components:

the PreMOn Ontology, an OWL 2 ontology that builds on OntoLex-Lemon (by the W3C Ontology Lexicon Community Group) for modeling the core concepts of semantic class (i.e., roleset in PropBank and NomBank, verb class in VerbNet, and frame in FrameNet), semantic role, mapping, and annotation common to all predicate models; and,

the PreMOn Dataset, a freely-available, interlinked RDF dataset containing the PropBank, NomBank, VerbNet, and FrameNet predicate model data (in various versions), the examples provided with the original resources, and the SemLink and PredicateMatrix mappings, published online as Linked Open Data according to the PreMOn Ontology.

Compared to the previous situation where each predicate model has its own proprietary XML format, PreMOn brings several benefits to users of predicate models:

ease of access and reuse of predicate model data, due to the adoption of a common RDF format, stable URIs, and LOD best practices;
possibility to abstract and capture the aspects common to different predicate models, while at the same time keeping track of the peculiarities of each model (using RDFS/OWL subclass/subproperty primitives);
possibility to apply SW technologies to predicate model data, such as automated reasoning and SPARQL querying, e.g., for retrieving the semantic classes of a lexical entry and the associated mappings;
possibility to combine PreMOn with other linguistic ontologies, e.g., for providing the SRL annotations of a text according to the NLP Interchange Format (NIF);
possibility for third parties to publish and interlink their datasets with PreMOn, extending it in a decentralized way (e.g., with new mappings).
These capabilities are particulary relevant in the context of Semantic Web (SW), where predicate models are increasingly used for information extraction, e.g., in tools such as NewsReader, PIKES, or as the starting point from which to derive ontologies of extracted knowledge, such as FrameBase and the ESO ontology both derived from FrameNet.Predicate Model For Ontologies (2018a version)
